import { Fragment } from "react";
import ScrollIndicator from "./ScrollIndicator";
import Navbar from "./Navbar";
import Footer from "./Footer";

const Layout = (props) => {
  return (
    <Fragment>
      <ScrollIndicator />
      <Navbar />
      {props.children}
      <Footer />
    </Fragment>
  );

};

export default Layout;
